import {  Link } from "react-router-dom";
const bar= () =>{
  return (
  <div>
    <li>
      <Link to="/">MyMixer</Link>
    </li>
    <li>
      <Link to="/essentials">Essentials</Link>
    </li>
  </div>
  );
}
export default bar;
